webpackJsonp([56278438203210],{1294:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/the-office-opening-ceremony/index.md absPath of file >>> MarkdownRemark",html:'<p>Remember a <a href="http://www.psyked.co.uk/press-release/moving-offices.htm" target="_blank">few weeks ago</a>, when I muttered something about moving offices?  Well, now we\'ve moved it was about time we had an official opening ceremony - regardless of how corny that might be - but hey, at least we\'ve something to celebrate.  (Especially if you pay much attention to the doom and gloom News).</p>\n<img class="alignnone size-full wp-image-386" title="officeopening" src="http://uploads.psyked.co.uk/2008/11/officeopening.jpg" alt="" width="500" height="280">\n<p>I know you\'re all wishing you were there, but there has to be a limit on attendance.  But fear not - if you weren\'t there on the day, we have a short film prepared, and will follow up with some photos from the day, just as soon as our official photographer gets sends the images over. ( Hint, hint - Mark ).</p>\n<p>Check out <a href="http://www.mmtdigital.co.uk/news" target="_blank">the news story on MMT Digital\'s website</a>, or check below the jump to watch our video.</p>\n<p><object classid="clsid:d27cdb6e-ae6d-11cf-96b8-444553540000" width="500" height="320" codebase="http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0"><param name="allowFullScreen" value="true" /><param name="allowscriptaccess" value="always" /><param name="src" value="http://www.mmtdigital.co.uk/mmtopening/mmtopeningflv.swf" /><embed type="application/x-shockwave-flash" width="500" height="320" src="http://www.mmtdigital.co.uk/mmtopening/mmtopeningflv.swf" allowscriptaccess="always" allowfullscreen="true"></embed></object></p>',frontmatter:{title:"The Office Opening Ceremony...",date:"November 25, 2008",tags:["mmt-digital","offices","opening"]}}},pathContext:{}}}});
